function getSearchResult(){let n=$("#FromDestinationId").val(),t=$("#ToDestinationId").val(),i=$("#DateOfDeparture").val();$.ajax({type:"GET",url:`/Search?`,contentType:"text/html; charset=utf-8",data:{FromDestinationId:n,ToDestinationId:t,DateOfDeparture:i},success:function(n){$("#searchResult").remove();$("#searchContainer").html(n)},error:function(n){console.log(n)}})}function filterTrips(){let n=$("#FromDestinationId").val(),t=$("#ToDestinationId").val(),i=$("#DateOfDeparture").val();$.ajax({type:"GET",url:`/Trips/Search?`,contentType:"text/html; charset=utf-8",data:{FromDestinationId:n,ToDestinationId:t,DateOfDeparture:i},success:function(n){$("#searchResult").remove();$("#searchContainer").html(n)},error:function(n){console.log(n)}})}function postSearchResult(){$.ajax({type:"POST",url:"/Search?"})}$(function(){$("time").each(function(n,t){const i=$(t).attr("datetime");if(i){const r=moment.utc(i).local();$(t).html(r.format("llll"));$(t).attr("title",$(t).attr("datetime"))}})});